import React from "react";
import { Stack, Box } from "@mui/system";
import { Typography, Paper } from "@mui/material";

function WorkoutForm({ WorkoutTracker }) {
  return (
    <div>
      <Stack sx={{ display: "flex", alignItems: "center" }}>
        <Box
          className="workoutplanner"
          sx={{
            width: 580,
            backgroundColor: "#6aa3bd",
            position: "relative",
            top: 32,
          }}
        >
          <Typography
            sx={{
              ml: 30,
            }}
          >
            Today's Training
          </Typography>
        </Box>
        <Box
          sx={{
            "& > :not(style)": {
              m: 1,
              width: 580,
              height: 450,
              backgroundColor: "#356c85",
            },
          }}
        >
          <Paper elevation={3} />
        </Box>
        <Box
          className="workoutplanner"
          sx={{
            bgcolor: "#6aa3bd",
            width: 580,
            position: "relative",
            bottom: 220,
          }}
        >
          <Typography
            sx={{
              ml: 28,
            }}
          >
            Last Time You Trained
          </Typography>
        </Box>
      </Stack>
    </div>
  );
}

export default WorkoutForm;
